INSERT INTO `event_history` (`id`, `judul3`, `isi3`, `gambar2`, `created_at`, `updated_at`) VALUES
(15, 'Festival Jajanan Nusantara 2025', '<p style=\"text-align: left;\" data-start=\"219\" data-end=\"487\">Rasakan pengalaman kuliner tak terlupakan di <strong data-start=\"264\" data-end=\"299\">Festival Jajanan Nusantara 2025</strong>!<br data-start=\"300\" data-end=\"303\">Puluhan stand jajanan dari berbagai daerah hadir membawa cita rasa khas Indonesia &ndash; mulai dari makanan tradisional, camilan kekinian, hingga minuman segar yang siap memanjakan lidah.</p>\r\n<p style=\"text-align: left;\" data-start=\"489\" data-end=\"574\">Selain menikmati aneka jajanan, pengunjung juga bisa merasakan suasana seru dengan:</p>\r\n<ul style=\"text-align: left;\" data-start=\"575\" data-end=\"799\">\r\n<li data-start=\"575\" data-end=\"617\">\r\n<p data-start=\"577\" data-end=\"617\"><strong data-start=\"577\" data-end=\"598\">Live Cooking Show</strong> dari chef lokal.</p>\r\n</li>\r\n<li data-start=\"618\" data-end=\"671\">\r\n<p data-start=\"620\" data-end=\"671\"><strong data-start=\"620\" data-end=\"646\">Kompetisi jajanan unik</strong> dengan hadiah menarik.</p>\r\n</li>\r\n<li data-start=\"672\" data-end=\"732\">\r\n<p data-start=\"674\" data-end=\"732\"><strong data-start=\"674\" data-end=\"701\">Spot foto instagramable</strong> bertema kuliner tradisional.</p>\r\n</li>\r\n<li data-start=\"733\" data-end=\"799\">\r\n<p data-start=\"735\" data-end=\"799\"><strong data-start=\"735\" data-end=\"766\">Live music &amp; hiburan rakyat</strong> untuk menemani suasana santai.</p>\r\n</li>\r\n</ul>\r\n<p style=\"text-align: left;\" data-start=\"801\" data-end=\"894\">Lokasi: Politeknik Bandung&nbsp;<br data-start=\"826\" data-end=\"829\">Tanggal: 17 &ndash; 20 September 2025<br data-start=\"863\" data-end=\"866\">Waktu: 09.00 &ndash; 17.00 WIB</p>', '1758263819_0e371e4f443c35760da4.jpg', '2025-09-19 15:41:51', '2025-09-19 15:41:51'),
(16, 'Festival Jajanan Nusantara 2026', '<p style=\"text-align: left;\" data-start=\"219\" data-end=\"487\">Rasakan pengalaman kuliner tak terlupakan di <strong data-start=\"264\" data-end=\"299\">Festival Jajanan Nusantara 2025</strong>!<br data-start=\"300\" data-end=\"303\">Puluhan stand jajanan dari berbagai daerah hadir membawa cita rasa khas Indonesia &ndash; mulai dari makanan tradisional, camilan kekinian, hingga minuman segar yang siap memanjakan lidah.</p>\r\n<p style=\"text-align: left;\" data-start=\"489\" data-end=\"574\">Selain menikmati aneka jajanan, pengunjung juga bisa merasakan suasana seru dengan:</p>\r\n<ul style=\"text-align: left;\" data-start=\"575\" data-end=\"799\">\r\n<li data-start=\"575\" data-end=\"617\">\r\n<p data-start=\"577\" data-end=\"617\"><strong data-start=\"577\" data-end=\"598\">Live Cooking Show</strong> dari chef lokal.</p>\r\n</li>\r\n<li data-start=\"618\" data-end=\"671\">\r\n<p data-start=\"620\" data-end=\"671\"><strong data-start=\"620\" data-end=\"646\">Kompetisi jajanan unik</strong> dengan hadiah menarik.</p>\r\n</li>\r\n<li data-start=\"672\" data-end=\"732\">\r\n<p data-start=\"674\" data-end=\"732\"><strong data-start=\"674\" data-end=\"701\">Spot foto instagramable</strong> bertema kuliner tradisional.</p>\r\n</li>\r\n<li data-start=\"733\" data-end=\"799\">\r\n<p data-start=\"735\" data-end=\"799\"><strong data-start=\"735\" data-end=\"766\">Live music &amp; hiburan rakyat</strong> untuk menemani suasana santai.</p>\r\n</li>\r\n</ul>\r\n<p style=\"text-align: left;\" data-start=\"801\" data-end=\"894\">Lokasi: Politeknik Bandung&nbsp;<br data-start=\"826\" data-end=\"829\">Tanggal: 17 &ndash; 20 September 2025<br data-start=\"863\" data-end=\"866\">Waktu: 09.00 &ndash; 17.00 WIB</p>', '1758263819_0e371e4f443c35760da4.jpg', '2025-09-19 16:45:34', '2025-09-19 16:45:34'),
(17, 'Festival Jajanan Nusantara 2027', '<p style=\"text-align: left;\" data-start=\"219\" data-end=\"487\">Rasakan pengalaman kuliner tak terlupakan di <strong data-start=\"264\" data-end=\"299\">Festival Jajanan Nusantara 2025</strong>!<br data-start=\"300\" data-end=\"303\">Puluhan stand jajanan dari berbagai daerah hadir membawa cita rasa khas Indonesia &ndash; mulai dari makanan tradisional, camilan kekinian, hingga minuman segar yang siap memanjakan lidah.</p>\r\n<p style=\"text-align: left;\" data-start=\"489\" data-end=\"574\">Selain menikmati aneka jajanan, pengunjung juga bisa merasakan suasana seru dengan:</p>\r\n<ul style=\"text-align: left;\" data-start=\"575\" data-end=\"799\">\r\n<li data-start=\"575\" data-end=\"617\">\r\n<p data-start=\"577\" data-end=\"617\"><strong data-start=\"577\" data-end=\"598\">Live Cooking Show</strong> dari chef lokal.</p>\r\n</li>\r\n<li data-start=\"618\" data-end=\"671\">\r\n<p data-start=\"620\" data-end=\"671\"><strong data-start=\"620\" data-end=\"646\">Kompetisi jajanan unik</strong> dengan hadiah menarik.</p>\r\n</li>\r\n<li data-start=\"672\" data-end=\"732\">\r\n<p data-start=\"674\" data-end=\"732\"><strong data-start=\"674\" data-end=\"701\">Spot foto instagramable</strong> bertema kuliner tradisional.</p>\r\n</li>\r\n<li data-start=\"733\" data-end=\"799\">\r\n<p data-start=\"735\" data-end=\"799\"><strong data-start=\"735\" data-end=\"766\">Live music &amp; hiburan rakyat</strong> untuk menemani suasana santai.</p>\r\n</li>\r\n</ul>\r\n<p style=\"text-align: left;\" data-start=\"801\" data-end=\"894\">Lokasi: Politeknik Bandung&nbsp;<br data-start=\"826\" data-end=\"829\">Tanggal: 17 &ndash; 20 September 2025<br data-start=\"863\" data-end=\"866\">Waktu: 09.00 &ndash; 17.00 WIB</p>', '1758263819_0e371e4f443c35760da4.jpg', '2025-09-19 16:45:44', '2025-09-19 16:45:44');
