(2108, 9, 'POST /admin/questionnaire/store', 'INFO', '{\"title\":\"SURVEY KEPUASAN PENGGUNA LULUSAN POLITEKNIK NEGERI BANDUNG\",\"deskripsi\":\"Yang terhormat Bapak\\/Ibu Pengguna Lulusan Polban,\\r\\n\\r\\nDalam upaya meningkatkan mutu lulusan agar memiliki kemampuan yang handal sebagai professional di bidang kerjanya masing-masing, kami mengharapkan tanggapan pengguna lulusan terkait kinerja lulusan Polban yang bekerja di Instansi\\/Perusahaan Bapak\\/Ibu. Survey ini bersifat terbatas, dan hasilnya akan digunakan sebagai bahan evaluasi internal Polban terhadap kinerja lulusannya.\\r\\n\\r\\nSurvey ini dilakukan secara online. Penyebaran informasi kepada pengguna lulusan tentang alamat tautan untuk pengisian data dilakukan melalui email ke alamat email perusahaan secara langsung atau via email lulusan Polban yang kemudian diteruskan ke email perusahaan Bapak\\/Ibu. Selanjutnya, Bapak\\/Ibu membuka alamat tautan tersebut, mengisi data yang diminta dan mengirimkan kuesioner yang telah diisi.\\r\\n\\r\\nKuesioner berisi pertanyaan tentang data pengisi, identitas instansi\\/perusahaan, dan kepuasan pengguna lulusan. Kami mohon agar setiap pertanyaan yang diajukan dijawab dengan sabar dan cermat. Kami menghaturkan penghargaan yang setinggi-tingginya atas kontribusi Bapak\\/Ibu dalam kegiatan ini. Terima kasih.\\r\\n\\r\\n\\r\\nAtas perhatian dan perkenaannya, Kami haturkan terima kasih\\r\\nPanitia Tim Tracer Polban\\r\\nTahun 2025\",\"announcement\":\"<p>TERIMAKSIH PARA ATASAN TELAH MEULANGKAN WAKTU UNTUK MENGISI SEKALIGUS MENILAI PARA ALUMNI KAMI \\ud83d\\ude4c\\ud83d\\ude4c\\ud83d\\udc4c<\\/p>\",\"is_active\":\"active\",\"conditional_logic\":\"1\",\"field_name\":[\"role_id\"],\"operator\":[\"is\"],\"value\":[\"8\"]}', 'localhost (::1)', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/142.0.0.0 Safari/537.36', '2025-11-26 05:41:06'),
