INSERT INTO `welcome_page` (`id`, `title_1`, `desc_1`, `title_2`, `desc_2`, `title_3`, `desc_3`, `image_path`, `youtube_url`, `updated_at`, `image_path_2`, `video_path`) VALUES
(1, 'Apa itu Tracer Study?', '<p style=\"text-align: center;\">Tracer Study adalah survei atau studi pelacakan lulusan/alumni oleh institusi pendidikan (biasanya kampus) untuk mengetahui: Keberadaan alumni setelah lulus (kerja, kuliah lagi, wirausaha, nganggur, dsb). Relevansi pendidikan yang mereka terima di kampus dengan dunia kerja nyata. Kepuasan mereka terhadap kampus (dosen, kurikulum, fasilitas). Kebutuhan dunia kerja yang bisa dijadikan masukan bagi kampus untuk meningkatkan kurikulum. Jadi, ini semacam feedback sistematis dari alumni untuk meningkatkan mutu pendidikan.</p>', 'Kenapa Tracer Study Itu Penting?', '<p style=\"text-align: center;\">Studi Penelusuran Alumni (Tracer Study) dilakukan untuk mengetahui masa transisi dari dunia kampus menuju dunia kerja dan untuk mendapatkan masukan bagi perbaikan sistem pendidikan POLBAN. Hasil dari survey ini akan menjadi data yang sangat berharga bagi POLBAN yang akan diperlukan bagi berbagai kebutuhan pengembangan dan kemajuan kampus POLBAN. Oleh karena itu, kami mohon kesediaan para alumni POLBAN yang kami banggakan untuk bekerjasama dalam mengisi kuesioner Tracer Study ini. Kuesioner Tracer Study yang digunakan di POLBAN terdiri dari 5 halaman utama dengan 1 halaman tambahan berupa kuesioner yang berasal dari program studi masing-masing (khusus program studi tertentu). Data tiap halaman akan tersimpan jika telah menekan tombol \"LANJUTKAN\"</p>', NULL, NULL, '/uploads/1758168769_0682fdbf0862fcc9f1c5.jpg', 'https://www.youtube.com/embed/dZsTR26OP84', '2025-10-22 08:30:49', '/uploads/1759905741_3d7db2e1fe4153041dec.jpeg', '/uploads/videos/1761121849_0cb1e4c13243c1d5325f.mp4');
