DELIMITER $$
CREATE TRIGGER `after_answer_delete` AFTER DELETE ON `answers` FOR EACH ROW BEGIN
    DECLARE remaining INT;

    -- Hitung sisa jawaban dari user untuk kuisioner yang sama
    SELECT COUNT(*) INTO remaining
    FROM answers
    WHERE questionnaire_id = OLD.questionnaire_id
      AND user_id = OLD.user_id;

    -- Kalau tidak ada jawaban tersisa, hapus response terkait
